import React from 'react';
import '../../css/videolist.css';
const ShowVideos = () => {
  // Dummy video data
  const videos = [
    { name: 'Video 1', url: 'https://www.example.com/video1', category: 'Butture shop' },
    { name: 'Video 2', url: 'https://www.example.com/video2', category: 'Hotel' },
    { name: 'Video 3', url: 'https://www.example.com/video3', category: 'Resturent' },
    // Add more dummy data as needed
  ];

  return (
    <div className="show-videos">
      <h2>Video List</h2>
      <ul className="video-list">
        {videos.map((video, index) => (
          <li key={index} className="video-item">
            <h3>{video.name}</h3>
            <p>Category: {video.category}</p>
            <a href={video.url} target="_blank" rel="noopener noreferrer">Watch Video</a>
          </li>
        ))}
      </ul>
    </div>
  );
};

export default ShowVideos;
